import { Container, Row, Col, Breadcrumb, BreadcrumbItem } from "shards-react";

// Layout
import Layout from "../components/Layout";

const Terms = props => (
  <Layout>
    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Terms and Conditions</BreadcrumbItem>
      </Breadcrumb>
    </Container>
  </Layout>
);

export default Terms;
